import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import DomainForm from "../components/DomainForm";
import { Card, CardContent, CardHeader, CardTitle, CardDescription } from "../components/ui/card";
import { Button } from "../components/ui/button";
import { Alert, AlertDescription, AlertTitle } from "../components/ui/alert";
import { InfoIcon } from "lucide-react";
import { useToast } from "../components/ui/use-toast";
import { DEFAULT_CONFIG } from "../utils/constants";

const Domain = () => {
  const navigate = useNavigate();
  const { toast } = useToast();
  const [loading, setLoading] = useState(true);
  const [config, setConfig] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    setLoading(true);
    try {
      const savedConfig = localStorage.getItem("wrf_config");
      if (savedConfig) {
        setConfig(JSON.parse(savedConfig));
      } else {
        setConfig(DEFAULT_CONFIG);
      }
    } catch (err) {
      console.error("Error loading config:", err);
      setError("加载配置时出错。请检查浏览器存储或重新开始。");
      setConfig(DEFAULT_CONFIG);
    } finally {
      setLoading(false);
    }
  }, []);

  const handleDomainSubmit = (domainData) => {
    try {
      // Update the domain section of the config
      const updatedConfig = {
        ...config,
        domain: domainData
      };

      // Save the updated config to localStorage
      localStorage.setItem("wrf_config", JSON.stringify(updatedConfig));
      setConfig(updatedConfig);

      // Show success notification
      toast({
        title: "成功",
        description: "网格设置已保存",
        status: "success",
        duration: 5000,
        isClosable: true,
      });
    } catch (err) {
      console.error("Error saving domain config:", err);
      toast({
        title: "错误",
        description: "保存网格设置失败",
        status: "error",
        duration: 5000,
        isClosable: true,
      });
    }
  };

  const handleDomainError = (message) => {
    toast({
      title: "表单验证失败",
      description: message,
      status: "error",
      duration: 5000,
      isClosable: true,
    });
  };

  const goToPhysics = () => {
    navigate("/physics");
  };

  const goToTime = () => {
    navigate("/time");
  };

  if (loading) {
    return (
      <div className="container mx-auto p-4">
        <Card>
          <CardContent className="pt-6">
            <div className="flex justify-center items-center h-64">
              <p className="text-lg">正在加载网格配置...</p>
            </div>
          </CardContent>
        </Card>
      </div>
    );
  }

  return (
    <div className="container mx-auto p-4">
      <Card>
        <CardHeader>
          <CardTitle className="text-2xl">网格设置</CardTitle>
          <CardDescription>
            配置 WRF 模型的网格信息，包括分辨率、投影和嵌套网格
          </CardDescription>
        </CardHeader>
        <CardContent>
          <Alert className="mb-6">
            <InfoIcon className="h-4 w-4" />
            <AlertTitle>网格设置指南</AlertTitle>
            <AlertDescription>
              请根据您的研究区域需求设置合适的网格参数。如需进行嵌套网格模拟，可增加嵌套网格数量并设置相应参数。
            </AlertDescription>
          </Alert>

          <DomainForm 
            initialValues={config?.domain || {}} 
            onSubmit={handleDomainSubmit}
            onError={handleDomainError}
          />

          <div className="flex justify-between mt-6">
            <Button 
              variant="outline" 
              onClick={goToTime}
            >
              返回时间设置
            </Button>
            <Button 
              onClick={goToPhysics}
              disabled={!config?.domain}
            >
              继续物理参数化设置
            </Button>
          </div>
        </CardContent>
      </Card>
    </div>
  );
};

export default Domain;
